import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { FormGroup, Label, Input } from 'reactstrap';

export default class BeneficiaryClient extends React.Component {
	constructor() {
		super();
		this.state = {
			idPsp: ''
		};
	}
	componentDidMount() {
		this.setState({ idPsp: Math.floor(Math.random() * Math.floor(10000000000)) });
		this.props.handleClickIdPsp(this.state.idPsp);
	}

	render() {
		return (
			<div>
				<Label style={{ color: 'grey' }}>NÂ° paiement</Label>
				<FormGroup>
					<Input
						type="text"
						name="PaiementNumber"
						id="PaiementNumber"
						maxLength="10"
						required
						value={this.state.idPsp ? this.state.idPsp : ''}
					/>
				</FormGroup>
			</div>
		);
	}
}
